import React,{ useState } from "react";
import {Button, Link, DialogTitle, Dialog, DialogActions, DialogContent, DialogContentText} from '@material-ui/core/';


export default function Modal() {
  const [open, setOpen] = React.useState(false);
  const [currPwd, setcurrPwd] = useState("");
  const [newPwd, setnewPwd] = useState("");
  const [verifyPwd, setverifyPwd] = useState("");

  const handleClickOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };

  return (
    <div>
        <div className="pwdLink">
            <Link onClick={handleClickOpen}>Change Password</Link>
        </div>
      <Dialog
        open={open}
        onClose={handleClose}
        aria-labelledby="alert-dialog-title"
        aria-describedby="alert-dialog-description"
      >
        <DialogTitle id="alert-dialog-title">
          {"Change Password"}
        </DialogTitle>
        <DialogContent>
          <DialogContentText id="alert-dialog-description">
          <form>
      <label>
        <p>Verify Password</p>
        <input
          type="password"
          value={verifyPwd}
          onChange={e => setverifyPwd(e.target.value)}
        />
